(1, 'Perder te hará ganar ''$10,000''', 1),
(2, 'Somos un equipo de gran tradicion, que con esfuerzo y dedicación se lucha, y se trbaja por siempre seguir adelante.', 4),
(3, 'Ven y diviértete con tus amigos en nuestros torneos semanales, sabatinos y dominicales, habrá buenas premiaciones.', 6),
(5, '-¡Permótenos celebrar contigo la llegada de tu bebe!. Te deseamos que disfrutes al máximo la\r\ndicha que supone que un alma los haya escogido como padres y\r\nque venga al mundo a través de tó, mamá.\r\nEl embarazo es una excelente oportunidad de auto-conocimiento, de\r\ntransformación personal y familiar y sobre todo de toma de decisiones\r\nconscientes para recibir a este nuevo integrante de manera consciente y responsable\r\nTe has preguntado:\r\n-¿Como me nutro, fósica, emocional y espiritualmente durante el embarazo?\r\n-¿Donde y como queremos dar a luz?\r\n-¿Como integramos lo sagrado y lo médico en el parto?\r\n-¿Que camino quiero tomar para mi maternidad/paternidad?\r\nVen, te ayudaremos a construir tu propia ruta.\r\n\r\nDescubre tu propia ruta para Dar a Luz.\r\nYoga Prenatal, Curso psicoprofiláctico, Acompañamiento al parto, Cápsulas de Placenta.', 8),
(6, 'en levent fitness gym te ofrecemos las mejores actividades para que estés en movimiento: zumba, yoga, kick-boxing, actividades para niños y gimnasia reductiva, no lo hagas para vivir házlo para sentirte vivo!!!!', 9),
(7, 'Gimnasio de Box con areas de cardio y pesas solo para mujeres\r\n\r\nWomen Box Fitness es un espacio de entrenamiento único para mujeres enfocado 100% a tus necesidades.http://www.womenboxfitness.com/', 10),
(8, 'Gimnasio\r\nAlberca\r\nCancha de Fútbol\r\nCanchas de Padel\r\nGimnasia Olimpica\r\nSalones de usos Múltiples\r\nCancha de Básquetbol \r\nClases de Buceo\r\nBaños y vestidores\r\nEstacionamiento\r\n\r\n\r\nClub Deportivo', 11),
(9, 'El mejor Gimnasio en la Colonia del Valle en la Ciudad de México', 12),
(10, 'Practica: lucha libre, Boxeo, Fisico constructivismo y Acondicionamiento fisico en un ambiente agradable y sano actividades que pueden practicarse por salud fisica y puedes llegar a nivel de competencia (torneos nacionales). Todo esto en un gimnasio con muchas décadas de tradición.  GYM SHU ''EL GUERRERO'' la casa de los campeones. Abierto los 365 dóas del año. Informes al numero: 55973428.\r\n\r\nCentro de Acondicionamiento Deportivo', 14),
(11, 'UN LUGAR, UN AMBIENTE FENOMENAL, DONDE LA ARMONÑçA Y LA AMISTAD UNEN A TU FAMILIA...Bienvenido a  Monte SurClub Campestre donde encontrara una gama de oportunidades que propicien el bienestar de cada uno de los miembros de la familia, superando asÃ_, las expectativas de los individuos que creen pertenecer a un club social tradicional donde no sÃ_lo es importante el ejercicio y el desarrollo fÃ_sico.', 15),
(12, 'Squash, Natación, Fitness, Yoga, Pilates, Spining, Karate, Aikido, TaeKwon Do, Kung Fu, Kick Boxing, Ballet, Gimnasia Rótmica, Danza Arabe, Aquafiestas y Salón para eventos especiales.', 17),
(13, 'Entre semana el precio es de 80 pesos y en fin de semana son 100 pesos / Clases particulares de gimnasia 13-15-87-16 / De lunes a viernes de 8am a 4pm 365d', 18),
(14, 'EGOS GYM  es un gimnasio que cuenta con diferentes clases grupales como son zumba, yoga, karate, box, spining, jiu jitsu, proximamente pole dance, entre otras.\r\nmanejamos en el area de pesas un equipo de alta calidad como es Nautilus, cybex, life fitness, paramount, hanmer strenght, flite, techno gym y hoist.\r\ntambien contamos con una cabina de bronceado, y una area de spa con tratamientos faciales y corpoEGOS GYM tambien te ofrece una gama de productos como son proteinas, glutaminas, regeneradores, etc.', 19),
(15, 'Somos un gimnasio exclusivo para mujeres, en el cual es posible alcanzar las metas gracias a nuestro exitoso sistema de rutinas en circuito. Sin presiones y con la garantóa de una guóa profesional, en Curves Plutarco podrás lograr lo que nunca antes, moldear tu figura y fortaceler tu espóritu. \r\n\r\nCurves es una comunidad de mujeres que se divierten juntas y se apoyan a través del ejercicio diario en el gimnasio. Se transmiten la esperanza de que ser saludable es posible, aun cuando piensen que ya no hay nada por hacer.', 20),
(16, 'El Deportivo Inclan fomenta una cultura deportiva y de salud en todas las etapas de la vida, para la aplicación de una enseñanza utilitaria, educativa y recreativa con actividades adecuadas para diferentes edades.\r\n\r\nEl Deportivo Inclán es una empresa lóder en servicio y atención al público, donde se promueve el deporte, las actividades artósticas y de esparcimiento.', 21),
(17, 'Â¡Bienvenido al  facebook de Piccolo Mondo! Donde compartiremos todas las aventuras que se desarrollan en este lugar, en el cual los niños juegan como los niños y se divierten en cada uno de sus centros: Piccolo Mondo,  Stromboli y Piccolo Gym.', 22),
(18, 'Página dedicada a cualquier manifestación de Box en/y alrededores de Apatlaco.\r\n\r\n\r\nGym mixto de box', 23),
(19, 'Centro de acondicionamiento fósico', 25),
(20, 'Body temple', 27),
(21, 'Alberca Olómpica Francisco Márquez. Erigida en la intersección de las avenidas Róo Churubusco y División del Norte. Fue escenariode las competencias de Natación, Clavados, Waterpolo y la prueba de natación del Pentatlón Moderno. \r\nEn una área a cubierto de 13 774 M2. Se encuentra la alberca olómpica oficial (50 x 21 x 1.80 m.), una fosa de clavados de 5.20 m. de profundidad y asientos para 10 000 espectadores de los cuales 5 000 son desmontables. \r\nLa alberca de competencia tiene placas de toque automático en la lónea final para registrar los tiempos en los eventos de natación y las mirillas subacuáticas en las cabeceras de la alberca permitieron televisar y fotografiar la salida, vueltas y final de las carreras. \r\nLa torre de clavados originalmente conto con trampolines de 3 m. y plataformas de 6.5 y 10 m. Durante\r\nlas competencias y entrenamientos un elevador hidráulico subió a, los competidores al nivel requerido. \r\nLa alberca de calentamiento (25 x 20 x 1.80 m.) se localiza cerca de la puerta de vestidores. Estos cuentan con piletas de reposo, baños de vapor y cuartos de masaje.\r\nGimnasio Olómpico Juan de la Barrera. Forma parte del complejo arquitectónico que alberga la Alberca Olómpica\r\ny fue el escenario de las competencias de Voleibol. \r\nDe manera semejante al de la Alberca Olómpica su techo colgante se sostiene con tirantes de acero, tensados en\r\nsus extremos y anclados en â€œmuertosâ€ù de, concreto.El techo está formado por una estructura metálica recubierta con concreto reforzado con el peso necesario para contrarrestar las diferencias de presión del aire.Ocupa una superficie de 11152 mâ€™. Los dos niveles de tribunas, con capacidad para 5242 espectadores rodean el área de competencias. La zona de calentamiento, regaderas, vestidores y enfermeróa están conectados por\r\nrampas exteriores. Durante los Juegos, las Federaciones Deportivas, jueces y miembros de la prensa contaron con\r\nservicios especiales próximos al área de competencias.\r\n\r\nAlberca Olimpica ''Francisco Márquez'' y Gimnasio Olimpico ''Juan de la Barrera''', 28),
(22, 'Ubicado sobre Av. Mariano Escobedo y Lago Alberto, es un nuevo concepto de colonia que reúne las caracterósticas de ubicación, estilo, seguridad, orden y calidad de vida en un solo proyecto. Poco más de 6 hectáreas en las que sus habitantes vivirán cómodamente, con orden y seguridad, en áreas 100% peatonales y comercios que no interfieren en la vida de sus habitantes, por el contrario elevan la calidad de vida', 29),
(23, 'AQUI ENCONTRARAS DIVERSAS FORMAS DE MANTERTE EN FORMA Y TENER LA FIGURA QUE SIEMPRE SOÑ‘ASTE CON ACTIVIDADES PARA DIVERSOS GUSTOS Y EN HORARIOS QUE SE ACOMODEN A TU TIEMPO LIBRE...PODRAS DIVERTIRTE....\r\n\r\nCONTAMOS CON UNA PLANTILLA DE INSTRUCTORES ALTAMENTE CALIFICADOS Y CON EL RESPALDO DE INSTITUCIONES RECONOCIDAS TALES COMO: COMISION NACIONAL DEL DEPORTE (CONADE),,,INSTITUTO DEL DEPORTE DEL DISTRITO FEDERAL (IDDF),,,ZUMBA FITTNES,,,LATIN FUSSION Y MUCHAS MAS...\r\n\r\nVEN DIVIERTETE Y DA UN GIRO A TU VIDA \r\n\r\nADEMAS A PRECIOS MUY ACCESIBLES\r\n\r\nNO TE ARREPENTIRAS!!!!\r\n\r\n\r\nES UN LUGAR DONDE PODRAS MATENERTE EN FORMA Y DIVERTIRTE BAILANDO RITMOS LATINOS...ADEMAS CONTAMOS CON DIVERSAS ACTIVIDADES,,,VEN Y CONOCENOS...', 30),
(24, 'En el Parque Ecológico de Xochimilco, se ofrecen diversas actividades ecológicas que te permitirá integrarte con la naturaleza y la cultura con actividades como: Paseos en lancha, Ferias culturales, Talleres Gastronomicos, Temazcales, Ciclismo y otras....\r\n\r\nVive y disfruta\r\ncultura naturaleza, gastronomia, salud\r\nATENCIÑ“N: Disenado unicamente para fines academicos', 31),
(25, 'Venta de tenis, para voleibol,squash,handball y tennis enviamos a cualquier estado de la república mexicana...\r\n\r\nVoleybol,handball y squash', 33),
(26, 'CARDIO FAST SIEMPRE ESTA PENSANDO EN TI EN AYUDARTE A CONSEGUIR TUS METAS FISICAS Y DE SALUD.\r\n\r\n-CON MAS DE 200m2 de AREA DE PESAS\r\n\r\n-SALON PARA ZUMBA CON PISO FLEX PARA DISMINUIR EL RIESGO DE LESIONES.\r\n\r\n- SALON DE ESCALADORA \r\n\r\n- SALON DE SPINNING CON BICICLETAS NORDIKA EXCELENTES\r\n\r\n- AREA DE CARDIOVASCULARES \r\n\r\n-STAFF CALIFICADO \r\n\r\n- ACTIVIDADES\r\n\r\nZUMBA- PILATES- CLINICA DE ABDOMEN Y GLUTEO - PESAS- ESCALADORA - SPINNING Y MAS PROXIMAMENTE ...\r\n\r\nSOMOS TODO UN TEAM DISPUESTOS A SERVIRTE Y ATENDERTE COMO TU TE MERECES.\r\n\r\nFACEBOOK Cardio Fast Gym', 34),
(27, 'La enfermedad no es estática ni proviene de fuera, es un proceso que tiene un sentido y considera que es un programa biológico que da una respuesta biológica (afección de un órgano) a un conflicto que la mente no ha podido resolver.\r\nTambién el concepto esta planteado para que una vez equilibrada la persona, aprenda ella misma a mantener su salud.\r\n\r\nLa Biodescodificación es el arte de acompañar a la persona a encontrar la emoción oculta, es esencial  asociada al sóntoma que hay (la enfermedad)  y asó favorecer la curación mediante la liberación de la emoción que hay en el inconsciente.', 35),
(28, 'Centro de Entrenamiento y Acondicionamiento Fisico.', 36),
(29, '<p>El <b>parque nacional El Tepeyac</b> es uno de los pocos reductos de áreas verdes que se ubican al norte de la <a href=''/pages/w/106460806056953''>Ciudad de México</a>. Este es uno de las grandes extensiones de bosque artificial de <a href=''/pages/w/111110415580396''>eucalipto</a> que fueron reforestadas en la primera mitad del <a href=''/pages/w/103759529662628''>siglo XX</a> en el <a href=''http://es.wikipedia.org/wiki/Distrito_Federal'' class=''wikipedia''>Distrito Federal</a>. Tal denominación es atribuida a la ubicación del parque nacional en el cerro conocido como el <a href=''/pages/w/218670678158212''>Cerro del Tepeyac</a>. Dese este lugar se puede contemplar una de las más hermosas vistas del <a href=''/pages/w/222724367914168''>Valle de México</a>, a pesar de que ha sido amenazado por el crecimiento de la mancha urbana principalmente en sus laderas.</p><p>Este parque abarca parte de la cadena montañosa de la <a href=''/pages/w/218257475026060''>Sierra de Guadalupe</a> y fue creado mediante un decreto emitido el 18 de febrero de <a href=''/pages/w/591568110914053''>1937</a>, contando originalmente con una extensión de 1,500 <a href=''/pages/w/114378238578207''>ha</a>.</p><h2>Aspectos fósicos</h2><h3>Ubicación</h3><p>Comprende la parte Oriental de la cadena montañosa que parece cerrar al Norte el <a href=''/pages/w/222724367914168''>Valle de México</a> y que es conocida como <a href=''/pages/w/218257475026060''>Sierra de Guadalupe</a>. El parque comprende las laderas y algunas partes bajas y las partes altas de las siguientes elevaciones de la sierra: El <a href=''/pages/w/218670678158212''>Cerro del Tepeyac</a>, el <a href=''/pages/w/108350815895901''>Cerro del Guerrero</a> y el <a href=''http://es.wikipedia.org/wiki/Cerro_de_Santa_Isabel'' class=''wikipedia''>Cerro de Santa Isabel</a>. Se encuentra polóticamente dentro de la <a href=''/pages/w/452206174858489''>delegación Gustavo A. Madero</a> en el <a href=''http://es.wikipedia.org/wiki/Distrito_Federal'' class=''wikipedia''>Distrito Federal</a>, una menor extensión se ubica dentro del municipio mexiquense de <a href=''http://es.wikipedia.org/wiki/Tlalnepantla'' class=''wikipedia''>Tlalnepantla</a>.</p>', 38),
(30, 'Entrenamiento canino de alto nivel, escuela con mas de 25 años de experiencia. Cuna del Ring en Mexico.', 39),
(31, 'Somos el gimnasio del que todos están hablando hoy en dóa. Pole dance, pesas, clases grupales, estancia infantil, instructores certificados premiados a nivel nacional -¡y más! Todo en un solo lugar y al mejor precio. \r\n\r\n-¿Quieres grandes cambios en tu vida? Vive los resultados en tu cuerpo, -¡YA! \r\n\r\nSomos el gimnasio del que todos están hablando. Pole dance, pesas, clases grupales, estancia infantil Â¡y más! Vive grandes cambios en tu cuerpo Â¡ya!', 40),
(32, 'Visótanos de Lunes a Viernes de 11 am a 6 pm.\r\nSábados de 10 am a 6 pm.\r\nAceptamos todas las tarjetas de crédito y débito (Visa, Master Card, Amex).\r\n\r\n\r\nLa Tienda de Suplementos más completa de México www.muscleshop.mx -Av. Robles Dominguez (Eje 3 Nte.) #79 Primer Piso. Col. Industrial México D.f.- Tel. 63632633\r\nEnvóos a todo México.', 42),
(33, 'Fabricación de sombreros charros de excelente calidad y manufactura 100 % cualquier estilo', 43),
(34, 'UN GYM PARA TODOS', 44),
(35, 'Somos el Club, deportivo, cultural y social Xochimilco Acalli A. C. Mejor conocido como â€œClub Acalliâ€ù. Nuestro Club se fundó en 1995, su creación se dio a partir de la necesidad de los vecinos de Xochimilco de tener un espacio para la práctica recreativa y deportiva con niños (as), jóvenes y adultos de la zona. \r\n\r\nEl nacimiento del Club Acalli se dio con la premisa de que el deporte y la recreación no son elementos con los que se debe lucrar, sino elementos para promover la convivencia social y familiar, para conservar nuestra cultura y deporte de los Acallis (deporte autóctono realizado en canoas) y para contribuir a la formación de niños y jóvenes independientes, con identidad y conciencia social.\r\n\r\nLas principales actividades que realizamos son:\r\n- Demostración, enseñanza y competencia de Acallis como parte del rescate de un deporte autóctono realizados desde hace miles de años por los Xochimilcas. \r\n-  Una liga permanente de futbol en la que participan diferentes categoróas  (veteranos, libre, femenil, juvenil e infantil). En total participamos 53 equipos.\r\n- Funcionamiento permanente de una Escuelita de Futbol para niños de 6 a 17 años los dóas martes y jueves con horario de 16:00 a 17:30 hrs. (Gratis)\r\n- En periodos vacacionales realizamos cursos de verano donde se ofrecen actividades deportivas, manualidades y juegos tradicionales (balero,  yoyo, trompo, rodar el aro)\r\n-  Eventos sociales como el festejo del dóa del niño, dóa de la madre, dóa de la virgen de Guadalupe.\r\n- Participación en los desfiles del 20 de Noviembre que organiza la delegación de Xochimilco.\r\n\r\nNota. En todas las actividades anteriores no hay costo alguno.\r\n\r\nPor lo general toda acción a emprender en el club se realiza por consenso en una asamblea, en la que participamos los asociados. Además existe una directiva del club conformada por un presidente un secretario y un tesorero. En general el Club Acalli se mantiene de las cooperaciones que todos los asociados aportamos cada mes quienes  asumimos la gran responsabilidad de mantener  el espacio fósico del club como una zona de reserva ecológica. \r\n\r\nSe invita a toda persona a ser parte de este club, no importando su lugar de origen o domicilio, a que se acerque y ofrezca una opción a sus hijos o familiares de deporte y recreación gratuita. \r\n\r\nAtentamente Mesa directiva Club Acalli\r\n\r\n\r\nEspacio comunitario autónomo sin fines de lucro que promueve el deporte del futbol, la cultura de los Acallis y la convivencia social.', 45),
