(41, 'Acuatic Balbuena (AB) predecesor de AQUATIK SPORT CENTER, abrió sus puertas en 1989 contando con una alberca únicamente de diez por cinco metros, una pequeña fuente de sodas y una vitrina como Boutique; un inicio modesto en sus medios, pero ambicioso en la altura de sus intenciones.\r\nDesde sus inicios (AB) tuvo excelente aceptación. Paulatinamente, año con año, consolidándose por la excelencia técnica de sus profesores, el buen servicio y el prestigio competitivo que iban alcanzando sus alumos.\r\nEn 1993 gracias al apoyo y confianza de los Ingenieros Ricardo Garay (qepd) y Eduardo Ruiz de Esparza quienes financiaron la obra, se logró la ampliación de (AB) constituyendose desde entonces como AQUATIK SPORT CENTER. \r\nLa expansión de sus instalaciones dio oportunidad tanto al crecimiento de su alumnado como a la proliferación de actividades, sin que el aspecto cualitativo de servicio y la enseñanza se viera afectados ante estas exigencias cuantitativas.\r\nAsó pues, gracias a esto y por supuesto a la entrega, esfuerzo y dedicación de todos los que de una u otra forma hemos laborado en ASC, es que ésta se ha ido conformando en lo que ahora es; un centro deportivo multidisciplinario con una proyección deportiva, de donde se desprende ya una sucursal en la zona poniente de la ciudad.   \r\n    \r\n\r\n\r\nAQUATIK SPORT CENTER', 52),
