(47, 'TECFIT - powered by Miha-Bodytec, es un sistema de entrenamiento semanal basado en la electro estimulación (EMS) que activa todo el cuerpo de forma simultánea a una intensidad muscular más alta que los sistemas convencionales.\r\n \r\nMediante una consola, un chaleco y bandas en brazos, glúteos y piernas â€“ sumado a 20 minutos de entrenamiento una vez a la semana - más de 300 fibras musculares son activadas a la vez a una profundidad e intensidad imposible de alcanzar con el ejercicio voluntario.\r\n\r\nCon lo anterior se logra: \r\n \r\n-  Tonificar y fortalecer de forma eficaz el abdomen, glúteos, brazos, piernas y cintura.\r\n- Reducir la grasa corporal e incrementar la producción de hormonas.\r\n- Generar hipertrofia sin carga articular.\r\n- Realizar movimientos especóficos de cada deporte y mejorar la coordinación intra e inter muscular.\r\n- Transformar fibras musculares intermedias a rápidas o lentas.\r\n-  Aliviar el dolor muscular, reduce dolor de rodillas, dolor de espalda, reduce nivel de estrés, mayor fuerza en las articulaciones, disminuye dolores de artritis, mejora en el sistema circulatorio, eliminación de toxinas, acelera el metabolismo, entre otros beneficios.  \r\n \r\nEl hecho de que la base metabólica se mantenga elevada hasta por 48 horas después del entrenamiento, convierte a TECFIT en el mejor sistema quema grasa que existe en la actualidad. \r\n \r\nTECFIT es apto para todas las edades y niveles de condición fósica, con tres enfoques principales de acondicionamiento:\r\n\r\n1.   Fitness\r\n2.   Belleza\r\n3.   Salud\r\n \r\nLa intensidad se regula de forma individual para cada parte del cuerpo lo que permite realizar cualquier tipo de entrenamiento, desde uno estático para personas con problemas de movilidad, hasta movimientos dinámicos como kick-boxing o técnicos como el tenis y golf; mejorando la fuerza y la velocidad, incluso en atletas de élite.\r\n\r\nAgenda tu primer entrenamiento sin costo para ti y dame tú opinión que súper valiosa para nosotros.\r\n\r\nEstamos en Plaza Inn (Insurgentes Sur 1971 Colonia Guadalupe Inn C.P. 01020) Nivel paseo local 330-A   Teléfono 5661-2807\r\n\r\n\r\nSistema de entrenamiento a partir de una traje de electro estimulación en el cual se activan hasta 300 fibras musculares en una sesión de 20 minutos.', 60),
