(60, 'GYM toñitos.\r\nSomos gente estrictamente dedicada al hierro, con fines de transmitir la adicción al deporte y a tener una mentalidad deportiva fuera de cualquier vicio excepto el ejercicio.\r\nSomos inteligentes, disciplinados, apasionados y estamos más interesados en producir un cambio que en hacer dinero.\r\nónete a nuestro equipo Si tienes visión y una mentalidad deportiva:\r\nTe esperamos en Isabel La Católica Num.341,col.obrera.\r\nDe Lunes a Viernes De 6:00 de la mañana a 10:00 de la noche,\r\ny sábados de 7:00 de la mañana a las 3:00 de la tarde,\r\nLo que importa no es pensar en el pasado ni el futuro lo importante es entrenar en el ahora Nunca estarás más joven que ahora,por eso ahora es el mejor dóa para empezar a entrenar.\r\n                                   Te esperamos todos los dóas unete\r\n\r\nTips, Humor, Motivación, Fotos, Vódeos, Noticias y todo lo relacionado con el levantamiento de pesas,Zumba,acondicionamiento fisico', 86),
