(76, 'Ubicado en Campos Eliseos 413, en una de las zonas más exclusivas de la Ciudad de México. Aquó se llevan a cabo la mayoróa de nuestras clases, capacitaciones para instructoras y talleres. Sede de nuestro corporativo y centro de operaciones.\r\nOfrecemos acondicionamiento fósico, a través de clases de Pole Fitness, con base en un método progresivo, efectivo y seguro, diseñado a partir de un programa de integración, capacitación, innovación y certificación continua con aval internacional, que permita generar conciencia de tu cuerpo de una forma divertida. \r\n\r\nEntra a www.facebook.com/gravitystudio o buscarnos también como @Clases de tubo.\r\n\r\nCon varias sucursales en el D.F. y área metropolitana Gravity Pole FItness Studio se a consolidado como el Studio de Pole Fitness mas importante del Paós. \r\nAlgunos logros.\r\n-1er Studio de Pole Fitness en México.\r\n-1er Studio con instructoras certificadas en el extranjero.\r\n-1er Studio en contar con Instructoras certificadas bajo los lineamientos de AFAA. \r\n-1er Studio en difundir la cultura de los primeros auxilios entre sus instructoras. (Actualmente requisito indispensable para las clases)\r\n-1er y único studio en desarrollar su propio programa de capacitación avalada en los Estados Unidos de Norte América por AFAA.\r\n-1er Studio en desarrollar un programa progresivo, efectivo y seguro de clases por niveles.\r\n-1er Studio en crear conciencia de la bio-mecánica en los movimientos. \r\n-1er Studio en combinar disciplinas como el Yoga, Pilates, danza, gimnasia y TRX para aplicarlas a la barra vertical o Pole. \r\n-1er Studio en promover implementar e impartir disciplinas alternas como soporte del Pole Fitness como el parado de manos y técnicas de flexibilidad y contorsión.\r\n-1er Studio en invitar y promover talleres de instructoras / performers extranjeras en México.\r\n-1er Studio en organizar el Showcase de Pole Fitness mas grande del mundo, GRAVITY FIRST.\r\n-1er Studio en aparecer en la sección ''Pole Around the world'' en la revista especializada en Pole y artes aéreas ''Vertical''.\r\n-Su creadora a sido la unica Creadora de única mexicana en ser oradora/ponente en la Pole Convention,  West palm Beach Florida USA.\r\n-1er Studio en desarrollar un sistema de franquicias. \r\n-1er Studio latinoamericano en tener una sucursal en EEUU. Gravity Pole Fitness Studio Key West, Florida USA.\r\n-1er Studio en ser anfitrión en la certificación especializada ''X-Pert''\r\n-1er Studio en traer a México a Jenyne Butterfly, Jamilla DeVille, Marlo Fisken, Pantera Blacksmith, Natasha Wang, Alethea Austin, Estee Zakar, Karol Helms, Leigh Ann Reilly, Zoraya Judd, Amy Guion, Nadia Sharif, Mina Mortezaie, Michula Nunez, Karol Helms, Steven Retcheles, Chris Measday, Justin McLucas, Rafaela Montanaro, Flying Laura, Michelle Stanek y las Campeonas en Brasil 2014 (1-º,2-º y 3er lugar) Veronica Solimano, Hanka Venselaar y Victoria Rame entre otras.\r\n-1er Studio en tener a 3 campeonas de EEUU de manera simultanea dando talleres en México. \r\n-1er Studio en el mundo en utilizar las redes sociales como un método efectivo de promoción y venta. \r\n-1er y único Studio en el mundo en tener mas de 105,000 likes en facebook.\r\n-1er Studio en México en aparecer fomentando la disciplina del Pole Fitness en programas en vivo en televisión nacional abierta y de paga.\r\n-ónico Studio colaborador en el documental ''Pole Life'' presentado en Las Vegas en 2012.\r\n-ónico Studio en ser invitado 3 veces a FOXSPORTS en Vivo. \r\n-ónico Studio en ser invitado 2 veces al programa de radio mas importante de México con Martha Debayle, WFM 96.9FM. \r\n-ónico Studio en haber sido invitado en vivo al programa de Claudia Arllano 98.5FM\r\n-ónico Studio en haber sido invitado al programa de radio ''La hora libre'' con Roy Macduch, 97.7FM.\r\n-Primer Studio en aparecer en publicaciones como Marie Claire, Chilango, Donde Ir asó como en los periódicos nacionales como El Universal y Reforma asó como periódicos locales como Publimetro, EL Grafico y Metro.\r\nVen y conoce a Jezabel Olmos Lemus, que no te cuenten. Aprende con la pionera del Pole en México. Creadora de Gravity Pole Fitness Studio-®, es la única mexicana en ser reconocida mundialmente como figura base del Pole Fitness en México.\r\n\r\n-¿Que esperas? Ven a volar con nosotros. \r\n\r\nNota importante:\r\nTodos las fotografóas y vódeos disponibles en Clases de Tuboï»¿ Gravity Satéliteï»¿ Gravity Studio Polancoï»¿ Gravity Studio Zona Esmeraldaï»¿ Gravity Pole Fitness Key Westï»¿ están protegidos por las leyes y disposiciones de tratados internacionales de derechos de autor. Estos material se ha colocado en este sitio de Internet bajo la autoridad de los titulares de los derechos con el único propósito de que los usuarios vean los materiales de este sitio unicamente. Todo uso distinto al establecido no esta permitido.\r\nLes rogamos de la manera mas atenta que si les gusta una foto, desean utilizarlas o compararla, se pongan en contacto con nosotros. \r\n\r\nUbicados en el corazón de Polanco en la calle de Campos Elóseos # 413. \r\nAnómate a vivir la diferencia donde las clases de tubo son Pole Fitness en serio.', 113),
