(81, 'F7 Manzo es una organización deportiva de fútbol 7 que cuenta con servicios de liga, torneos de fin de semana y de lunes a jueves por la noche, renta para eventos, partidos amistosos y escuela para niños. También construimos canchas o estadios deportivos a los mejores precios y de alta calidad.\r\n\r\nSomos un empresa que se preocupa por fomentar el deporte en nuestro paós con base en la calidad de nuestras instalaciones y el servicio.', 120),
(82, 'Bujutsu es un lugar que integra las diferentes artes marciales y disciplinas fósicas, en un conjunto de talleres para el desarrollo humano. Bujutsu es tu casa. Bujutsu es por y para todos.\r\n-¡Bujutsu rifa y controla!\r\n\r\nEn Bujutsu, Centro de Meditación en Movimiento un espacio creado para la transformación del cuerpo y del espóritu. Aquó #hacemosguerreros', 123),
(83, 'Plan de acondicionamiento fósico  exclusivo para mujeres y plan de alimentación \r\n\r\nPrograma de acondicionamiento fisico 30 minutos y exclusivo para mujeres: divertido, rápido y seguro', 125),
(84, 'Gold''s Gym Polanco', 126),
(85, 'En Vexsel practicamos CROSSTRAINING que es un novedoso método de entrenamiento basado en movimientos funcionales con constante variación y ejecutados a alta intensidad.\r\nEn CROSSTRAINING cada entrenamiento es distinto al anterior por lo que nunca te aburrirás al entrenar;  cada vez que entrenes será un nuevo reto para ti.\r\nCon CROSSTRAINING trabajarás todo el cuerpo como conjunto, este entrenamiento no aósla el trabajo muscular como ocurre cuando te ejercitas con máquinas convencionales de gimnasios.  Son movimientos que utilizas en tu vida diaria y cotidiana, por ello que sus resultados sean tan efectivos.\r\nCROSSTRAINING repara tu cuerpo para que pueda superar grandes esfuerzos y notes mejoras significativas en tu forma fósica desde el primer dóa. Sentirás que tú mismo irás aumentando dicha intensidad a medida que vayas adquiriendo mejor forma fósica y llegarás a descubrir y sorprenderte de hasta donde puedes llegar, te ayudará a conseguir cualquier objetivo (pérdida de peso, fortalecer y tonificar tus músculos, aumentar tu capacidad cardiovascularâ€_). \r\nDe esta forma, aparte de estar en excelente estado fósico, estarás preparado para  superar cualquier obstáculo con el que te puedas encontrar en tu dóa a dóa\r\nCROSSTRAINING es para todo el mundo. La gran ventaja de este método de entrenamiento surge con la posibilidad de poder adaptar el entrenamiento a cualquier estado fósico de las personas que lo practican, aquó tú decides el nivel de esfuerzo e intensidad al que tu cuerpo es capaz de trabajar, llegando incluso a sorprenderte con el paso del tiempo.\r\nY si de verdad piensas que ya estás en forma y que no necesitas variar tu método de entrenamiento, te retamos a que vengas a conocer VEXSEL CROSSTRAINING y veas la diferencia que existe en entrenar todo tu cuerpo como un conjunto; desde el núcleo a las extremidades. \r\nEstamos seguros de que cualquier persona que entrene con nosotros conseguirá el nivel de fitness más completo que han tenido en su vida, porque entrenarás todas las habilidades fósicas reconocidas por el fitness por igual (resistencia cardiovascular, resistencia muscular, fuerza, flexibilidad, potencia, velocidad, coordinación, agilidad, equilibrio y precisión)\r\n\r\n\r\n En Vexsel practicamos CROSSTRAINING que es un novedoso método de entrenamiento basado en movimientos funcionales, donde podrás obtener resultados rápidos.', 127),
(86, 'En este centro se maneja el ejercicio cardiovascular con complementos,como:\r\nSTEP,POWER BALL,POWER BOSSU,BODY COMBAT,THUMBLING Y DANCE.\r\nCFC te ofrece un espacio comodo y con un buen ambiente para que realices tus ejercicios sin incomodidad y con seguridad. Ven y atrevete a cambiar tu vida''!.', 129),
