(95, 'El Gimnasio de Arte y Cultura es un espacio educativo que fometa y promueve las producción y el desarrollo artóstico por medio de talleres, actividades en fotografóa y artes visuales, con la finalidad de formar autores a través de la vinculación con profesores y artistas, además de contribuir con la oferta cultural y educativa de la Ciudad de México y de San Cristobal de las Casas, Chiapas.\r\n\r\nEspacio educativo que fomenta y promueve las producción y el desarrollo artóstico por medio de talleres, actividades en fotografóa y artes visuales', 142),
(96, 'Escuela de Futbol Soccer para niño@s de 3 a 15 años, contamos con instalaciones privadas, cancha de pasto natural y material de primer nivel.\r\nNuestra misión es ser una escuela formativa agradable y divertida, donde los niños no sólo aprendan fútbol. Valores básicos, tales como respeto, compromiso y trabajo en equipo son muy importantes para nosotros y les serán inculcados a los alumnos por nuestro gran equipo de jóvenes y entusiastas entrenadores.\r\n\r\nEscuela de Futbol Soccer', 143),
