(102, 'Sucursales en:\r\nColonia Del Valle/Narvarte y Copilco\r\n\r\nINFORMES:\r\npoledancers@hotmail.com\r\n65670152\r\n\r\nAprende y practica el Pole Dance. El Pole Dance es un deporte que te ayudara a tener fuerza, tonificar los músculos, bajar de peso y adquirir elasticidad de una manera muy divertida. Pole Dancers te ofrece clases personalizadas con pocas alumnas por sesión, para que te sientas cómoda y puedas aprovechar los 60 min de la clase!!\r\n\r\nCONTAMOS CON CLASES DE CHAIR DANCE, STRETCHING Y POLE ARIA\r\n\r\nEstudio de Pole Dance Certificado Internacionalmente por Pole Moves Los Angeles. Dirigido por Diana Pardo quien gano el segundo lugar en la competencia internacional IDSA 2012 en Beijin y unica master trainer que certifica internacionalmente en México.', 154),
