(109, 'Hola . . . Lindo Dóa . . . Te mando la información requerida esperando que sea de tu interés . . .\r\n \r\nTenemos Spinning, Tae-Bo, Zumba, Acondicionamiento Fósico y Life Training.\r\n \r\nTae-Bo es como Kick Boxing pero sin contacto, se marcan golpes y patadas y todo es aeróbico. Es una acitivdad para quemar grasa y la tenemos: Lunes y Miércoles a las 5:00 y 9:00 p.m. y Lunes, Miércoles y Viernes a las 7:00 p.m.\r\n \r\nZumba es una combinación de los diferentes ritmos latinos con un toque de Fitness y es para quemar grasa, la tenemos: De Lunes a Viernes a las 9:00a.m. Martes y Jueves a las 5:00 p.m. De Lunes a Viernes a las 6:00 p.m. y Lunes, Miércoles y Viernes a las 8:00 p.m.\r\n \r\nZumbatomic es una actividad basada en Zumba pero especialmente diseñada para niños que van desde los 4 hasta los 12 años, la tenemos Lunes y Miércoles a las 4:30 p.m. \r\nLa clase de Zumbatomic tiene un costo de 30 pesos . . . Y el paquete por 8 clases es de 220 pesos . . .\r\n \r\nLife Training es exactamente lo mismo que Acondicionamiento Fósico sólo que las estamos manejando con diferente nombre y es una actividad para hacer fuerza en el cuerpo y tonificarlo, en donde se utilizan mancuernas, ligas y pelotas, polainas y la tenemos Martes y Jueves a las 7:00 p.m. y a las 8:00 p.m. \r\n\r\nSpinning es una actividad para quemar grasa y tonificar el cuerpo al mismo tiempo. Lo tengo Lunes, Miércoles y Viernes a las 6:00, 7:00 y 8:00 p.m. Lunes y Miércoles a las 9:00 p.m. y Martes y Jueves de 6:00 p.m., 7:00 p.m y 8:00 p.m. \r\n\r\nLos costos los manejo por paquetes o por clase individual. \r\n\r\nEl costo de Spinning es: Clase Individual: 35 pesos, Paquete de 8 clases CONSECUTIVAS 240 pesos (Grupos de Martes y Jueves o Lunes y Miércoles) y Paquete de 12 clases CONSECUTIVAS 300 pesos (Grupos de Lunes, Miércoles y Viernes) . . .\r\n \r\nLos costos para Tae-Bo, Zumba, Life Training y Acondicionamiento Fósico son: El paquete de 8 clases CONSECUTIVAS es de 220 pesos (Grupos de Martes y Jueves o Lunes y Miércoles) y el costo por paquete de 12 clases CONSECUTIVAS es de 280 pesos (Grupos de Lunes, Miércoles y Viernes) . . . La clase individual en estas actividades tiene un costo de 25 pesos . . .\r\n\r\nLo que más te conviene es un paquete ya que, el cupo es limitado y las personas que cuentan con paquete tienen preferencia de entrada. . .\r\n\r\nLo que necesites estoy a tus órdenes en este mail, en el 044 55 23 43 20 06 o en el Gimnasio en un horario de 4 de la tarde a 10 de la noche . . .\r\n \r\nEn Facebook me encuentras como Patricia Argóelles Garcóa o con el mail arguegar@hotmail.com', 163),
(110, 'Te gusta el futbol?  No lo pienses mas  aquó organizamos torneos empresariales, escuelas, club, filiales  y  partidos amistosos,  nos ajustamos a tus necesidades.\r\nTorneos semanales, sabatinos y dominicales turno matutino vespertino y nocturno.  Renta de la cancha para eventos especiales como exhibiciones, expos o entrenamientos etc.\r\n\r\nServicios:\r\n1 Cancha de Futbol Soccer Profesional (Pasto Sintetico de la mas alta tecnologia)\r\n4 Canchas de Fut 7 (Pasto sintetico)\r\n\r\nComplementos:\r\n*Arbitros Centrales y abanderados (Semi Profesionales)(Profesional) Opciona!l\r\n*Banderines de esquina\r\n*Bancas para jugadores y cuerpo tecnico\r\n*Zona de calentamiento local Y visitante\r\n*Vestidores Local y Vistitante\r\n*Baños Mujeres y Baños de Hombres\r\n*Gradas para 300 personas ubicandose 4 gradas en la cancha de futbol Soccer y 1 *Grada en las canchas de fut 7\r\n*Porterias importadas\r\n*Redes para balones (para agilizar el juego)\r\n*Zona enrejada de seguridad\r\n*Zona especial para niños con 2 canchitas de futbol de salon y 4 de tenis balon (Zona enrejada para que usted como jugardor sepa que su familiar esta protejido en nuestra intalaciones)\r\n*En torneos empresariales (acceso con credenciales de su empresa)  Esto es Opcional si la empresa lo autoriza\r\nSeguridad y Vigilancia (Estacionamiento y Instalaciones)\r\n*Servicio de Alumbrado Tipo Estadio\r\n*Estadisticas, Goleo y premiacion en Torneos.\r\n*Ciclopista al interior de la cancha\r\n*Estacionamiento                                                                                                \r\n*Factura Electronica 16%iva\r\n*Contrato Firmado\r\n-----------------------------------------------------------------------------------------------\r\n\r\nProyectos Recientes: ''Toneos Empresariales''\r\nBanco Grupo HSBC (Proovedor Oficia)\r\nBanco Grupo SANTANDER(Proovedor Oficia)\r\nBanco Grupo  BANCOMER\r\nPGR (Proovedor Oficia)l\r\nFinanciera Equipa (Proovedor Oficia)l\r\nNueva Alianza\r\nADO (autobuses de mexico) (Proovedor Oficia)l\r\nERNST & YOUNG\r\nTelcel\r\nMovistar\r\nCoca Cola\r\nSep\r\netc...\r\n\r\nToneos Locales del Centro De Futbol Calles\r\nLocalia en partidos de 3ra y 2da división Profesional, premier, sector aficionado. (Panteras Lindavista, Azulgrana, Potros, Panteras Negras, Cefor Cuauhtemoc Blanco, Concorde)\r\n\r\nEntre Otras....\r\n\r\nSimplemente contamos con las mejores Instalaciones de la ciudad de Mexico avalados por la femexfut y fomento deportivo.\r\n\r\nNo dejes pasar la oportunidad anómate y demuestra que tu equipo es el Campeón!!\r\nSolicita un partido amistoso'''' y no te arrepentiras!!\r\n\r\nHonestidad, responsabilidad, actitud por el servicio y Puntualidad es lo que nos hace ser únicos.\r\n\r\nAtentamente: Gerente Deportivo Empresarial: PROF.  ARTURO MADRIGAL CASASOLA.\r\n\r\n\r\n\r\nCancha De Futbol Soccer y 4 Canchas de fut 7', 165),
(111, 'BodyWords ofrece técnicas innovadoras que propician bienestar fósico, mental y espiritual.\r\n\r\nUtilizamos la palabra hoóstico para reflejar nuestro interés por hacer consciente la integración entre cuerpo, mente y espóritu en nuestros clientes. Rescatando filosofóas orientales antiguas pero a su vez adaptándolas a la vida moderna y a las necesidades especóficas de nuestra sociedad, utilizando como herramienta principal el movimiento del cuerpo.\r\n\r\nBasamos nuestra a filosofóa en las teoróas y métodos de trabajo de diferentes profesionales destacados de la psicologóa, la danza, el yoga y el movimiento.\r\n\r\n\r\nBodyWords es un centro holóstico de movimiento, un espacio creativo de expresión y desarrollo personal a través del movimiento y el cuerpo.', 166),
(112, 'el mejor gimnasio de box de México', 167),
(113, 'Futbol Rapido la Joya es un centro recreativo y de esparcimiento familiar en condiciones optimas para practicar futbol. Fomentando el acondicionamiento fisico en conjunto a través de la competencia deportiva sana en un contexto de lealtad y respeto.\r\n\r\nFútbol rápido la joya es un centro recreativo y de esparcimiento familiar en condiciones optimas para la práctica del futbol.', 168),
