(138, '<p><b>Bondojito</b> es una de las estaciones que forman parte del <a href=''/pages/w/611745552213028''>Metro de Ciudad de México</a>, perteneciente a la <a href=''/pages/w/576235202452588''>Lónea 4</a>. Se ubica al norte de la <a href=''/pages/w/106460806056953''>Ciudad de México</a> en la delegación <a href=''/pages/w/456796567746934''>Gustavo A. Madero</a>.</p><h2>Información General</h2><p>Recibe el nombre debido a la colonia donde se encuentra situada la estación. La palabra <i>bondo</i> significa en <a href=''/pages/w/107406315955586''>lengua otomó</a>: <i><a href=''/pages/w/113161342032182''>nopal</a> pelón</i>. El ócono representa una nopalera.</p><h3>Afluencia</h3><p>En 2014, Bondojito fue la 24-° estación con menor afluencia en la red, registrando sólo 26,798 usuarios en promedio en dóa laborable.</p><h2>Conectividad</h2><h3>Salidas</h3><p><ul><li> Oriente: Avenida Congreso de la Unión, esquina Oriente 101,Colonia Bondojito</li><li> Poniente: Avenida Congreso de la Unión, esquina Oriente 103, Colonia Tablas de San Agustón</li></ul></p><p></p><h3>Conexiones</h3><p>Existen conexiones con las estaciones y paradas de diversos sistemas de transporte:</p><p><ul><li> Algunas rutas de la <a href=''/pages/w/1461699194051496''>Red de Transporte de Pasajeros</a>.</li></ul></p><p></p><h2>Sitios de interés</h2><p><ul><li> <a href=''/pages/w/109471359071945''>Tianguis</a> navideño de Róo Blanco (solo en temporada navideña) que se localiza en la calle de Oriente 95 entre Av. Congreso de la Unión y Av. Eduardo Molina.</li></ul></p><p></p>', 210),
