(144, 'Bienvenidos a Close Range Combat Academy (CRCA) Wing Chun Gung Fu México''\r\n\r\nWing Chun Gung Fu es un Arte marcial proveniente de China, diseñada para combate a corta distancia. Se basa en la Economóa de Movimiento, Velocidad, Tiempo de Reacción, Potencia, Estructura Angular y La Teoróa de la Lónea Central.\r\n\r\nSifu Randy Williams es el fundador del sistema â€œClose Range Combat Academyâ€ù (CRCA), con más de 40 años de práctica y estudio. Asó mismo, cuenta con academias en los EE.UU., México, Chile, Australia, Austria, Singapur, Sudáfrica y varios paises de Europa. Año con año realiza seminarios en cada una de estas academias difundiendo su conocimiento sobre Wing Chun por el mundo.\r\n\r\nSu dedicación y popularidad han llevado al Sifu Randy Williams a trabajar con famosos como Al Pacino, Andy Garcóa y Antonio Banderas, además de haber trabajado como guardaespaldas de estrellas como Steven Seagal, Eric Clapton, Phil Collins y U2. \r\n\r\nTe invitamos a practicar la disciplinal que te ayudará a mejorar tu confianza, habilidades motoras, capacidad de concentración y reflejos.\r\n\r\n''Aprende a utilizar técnicas modernas aplicadas a situaciones reales\r\n\r\nClose Range Combat Academy Wing Chun:  Arte marcial proveniente de China, diseñada para combate a corta distancia. Sifu Randy Williams es el fundador del sistema â€œClose Range Combat Academyâ€ù (CRCA) Wing Chun Gung Fu', 225),
