(202, 'Abrimos nuestras puertas en 1997 y desde entonces estamos comprometidos en  brindar a nuestros clientes la mejor experiencia deportiva y poner a su disposición las mejores instalaciones profesionales, siempre con la mejor disposición y calidad de servicio. \r\n\r\nPara nosotros es muy importante promover en nuestra sociedad la cultura del deporte, por los que desde hace 15 años estamos involucrados en crear estilos de vida propicios para mejorar la calidad de vida y favorecer el desarrollo humano y social.\r\n\r\nEl objetivo principal del Squash Ciudad de México es procurar el bienestar fósico, psicológico y social del ser humano mediante el fomento del deporte.\r\n\r\nCreemos que el deporte es parte fundamental en el desarrollo integral de los seres humanos, por lo que buscamos inculcar la cultura del deporte en las personas desde temprana edad y hasta la edad adulta, acercar a aquellos que lo han dejado y despertar el interés en quienes no tienen el hábito del deporte.\r\n\r\nContamos con 8 canchas de squash tipo inglesas y 2 de racquetball, amplios vestidores y regaderas, cafeteróa y servicio de valet parking. Todas nuestras canchas tienen piso de duela, medidas oficiales y pared de rebote de cristal.', 321),
