(221, 'Renzo Gracie México es la academia de Jiujitsu Brasileño con más prestigio y antigóedad en nuestro paós. Contamos con una experiencia de cerca de 15 años en la práctica y enseñanza del Jiujitsu Brasileño (BJJ, por sus siglas en inglés), logrando un nivel técnico y competitivo tal que nos ha permitido ser la academia lóder en nuestro arte, consiguiendo el campeonato nacional por cinco ocasiones consecutivas. En la Academia Renzo Gracie México estamos orgullosos de ser pioneros y vanguardia del BJJ en nuestro paós.\r\n\r\nRenzo Gracie México es la academia de Jiujitsu Brasileño con más prestigio y antigóedad en nuestro paós. Contamos con una experiencia de cerca de 15 años en la práctica y enseñanza del Jiujitsu Brasileño.', 347),
