(228, 'UN NUEVO CONCEPTO DE POLE DANCE FITNESS E IMAGEN Y ESTILO PERSONAL.\r\n\r\nINICIAMOS CLASES EL DIA 1o. DE DICIEMBRE DEL 2014.\r\n\r\nVEN Y UNETE A NUESTRO EQUIPO. \r\nYA  ESTAMOS INSCRIBIENDO.... CUPO LIMITADO POR CLASE.\r\n\r\nNO ESTAMOS COBRANDO INSCRIPCIONES POR PROMOCIÑ“N DE INAUGURACIÑ“N, SOLO COLEGIATURA\r\n\r\nPAGO AL MES DE $900 PESOS CON DERECHO A 2 CLASES A LA SEMANA, TOTAL 8 CLASES AL MES.\r\n\r\nSI ERES DE LAS PRIMERAS 20 PERSONAS EN INSCRIBIRTE A LAS CLASES, TE OBSEQUIAREMOS UN ESTUDIO DE COLOR.\r\n\r\nCONTAMOS CON GRANDES PROMOCIONES POR INAUGURACIÑ“N\r\n\r\n-¿QUIERES APRENDER A COMBINAR TU ROPA O USAR LO QUE MEJOR LE QUEDA A TU CUERPO?... NOSOTROS TE AYUDAMOS. ATREVETE A  MEJORAR TU IMAGEN PERSONAL CON ASESORIAS DE IMAGEN Y ESTILO.... PORQUE VERTE BIEN, NO TIENE QUE SER TAN CARO.\r\n\r\nTE ESPERAMOS!!!!!\r\n\r\n\r\n\r\nClases de Pole Dance y Asesoróa  en  Imagen  Personal. \r\nAtrévete!!!  Despierta  la sensualidad que llevas dentro y saca provecho de lo mejor de tu imagen.', 354),
