(230, 'Club de ajedrez mas importante del paós, su principal labor es organizar torneos, fundado por el Maestro Nacional Luis Vaca Kram, quien dedicó toda su vida en la promoción y organización de torneos validos por la federación internacional de ajedrez, ante la falta de torneos serios por su validez, se ha tenido la vision de organizarlos de una forma flexible y sobre todo facilitar su organizacion\r\n\r\nEl club de ajedrez mas importante de organización de torneos del paós', 356),
(231, 'FILOSOFÑçA\r\nGanar es un hábito, el entusiasmo es jugar con pasión y entrega para llegar a la gloria, cada fibra de nuestro cuerpo es la esencia del amor al deporte. Las reglas de la cancha son el respeto por la disciplina. \r\n\r\nSomos una organización deportiva, dirigida a personas interesadas a la práctica del tocho bandera en sus modalidades: varonil, femenil y mixto.', 357),
