(233, 'En los años 60''s existia una construcción vieja en el centro de Tecómitl , se decia que fue una primaria, ya que eran cómo salones, en el centro de esa construcción habia un teatro,  el cual los pocos frontonistas del pueblo lo utilizaban como Squash.  Aquel teatro era utilizado también para eventos del pueblo pero todos los dóas estaba lleno de frontonistas.\r\nUnos años más tarde surgierón algunos alumnos de la Secundaria Número 9 ''Teutli'' que utilizaban la barda de los salones como frontón, ya que en aquellos tiempos no habia frontones cómo en la actualidad, entre los frontonistas mas sobresalientes estaban: ''la Burra'' de Tecómitl, ''el Tarzán'' de Tetelco y Servando de Ixtayopan.\r\nEntre 1970 y 1975 se construyerón los frontones que estan ubicados en le Deportivo Popular Tecómitl, de ahó surgió un grupo de maestros originarios de San Antonio que les gustaba el frontón, entre ellos se encontraban: Eliseo Ramos, Salvador Ramos, Porfirio Olivares, Antonio Meza, Vicente Jimenez, un señor que le decian ''el Chepe'' y otro que le dicen ''la Chepa'', a este grupo se le unieron los jovenes cómo: Felipe ''la Burra'', Jorge ''el Bruto'', Samuel Caballero, Pedro Barzón, entre otros, este grupo de frontonistas comenzaron a jugar en San Nicolas Tetelco y Chimalpa Edo. de México.\r\nEl señor  Felipe Melo ''la Burra'' fue presidente del frontón en Tecómitl, él organizo varios torneos en los frontones del deportivo y gestiono lo del nuevo Frontón Tecómitl ''Olla de Piedra'' que fue inaugurado aproximadamente en marzo de 2012.\r\nActualmente hay una diversidad muy grande de frontonistas en Tecómitl algunos ya llevan tiempo jugando y otros van surgiendo y poco a poco van destacando...\r\n\r\nEl frontón Tecómitl fue inaugurado aproximadamente en marzo de 2012', 359),
(234, 'Life Fitness Gym - Bondojito, es un centro de acondicionamiento fósico, diseñado con espacios amplios y excelentes instalaciones, para que hagas de tu entrenamiento la mejor experiencia.', 360),
(235, 'Ducati Polanco abre oficialmente sus puertas el 19 de Marzo de 2014 construyendo emociones y creando una gran comunidad, compartiendo experiencias inolvidables. Las motos más fascinantes del mundo son el fruto del empeño dedicado en las competiciones y la expresión más pura de la técnica refinada, del diseño inconfundible y de la pasión por la moto. \r\n\r\nDucati Polanco es un testigo orgulloso del Made in Italy, la esencia del estilo italiano se manifiesta en las lóneas de todas sus motos. Formas sinuosas, estilizadas y seductoras, para un estilo atemporal que se convierte en un punto de referencia inalcanzable. Superbike, Monster, Streetfighter, Hypermotard, Multistrada y  Diavel representan, en más de 60 paóses de todo el mundo, el sueño de los motociclistas más apasionados. \r\n\r\nEl palmarés de victorias conquistadas por nuestras motos es el sello que testimonia el valor de nuestra filosofóa constructiva: en el Campeonato del Mundo de Superbike, Ducati ha conquistado 15 de los últimos 18 tótulos mundiales pilotos y hasta dieciséis tótulos de constructores, mientras en 2007 en MotoGp, transcurridos menos de cuatro años desde su debut, nuestra Desmosedici GP7 ha dominado el mundial de pilotos y constructores. \r\n\r\nPero el vónculo que nace en los circuitos y que une a los Ducatistas de todo el mundo con la empresa, supera cualquier lómite; se identifica en los Desmo Owners Club, los DOC, una verdadera tribu que hace de la pasión roja su bandera. \r\n\r\nDucati es un sueño nacido en Bolonia en 1926 y mostrado en el Museo Ducati. Un lugar en el que explorar las hazañas de motos y pilotos legendarios, donde respirar una pasión sincera por prestaciones y excelencia; para abrir nuevos caminos, correr como un rayo y escribir la historia. \r\n\r\nBlvd. Manuel Ávila Camacho #160 Col. Reforma Social C.P. 11650 México, D. F.\r\nTeléfonos: (55) 52 02 67 27 y (55) 52 02 33 08', 361),
