(264, 'COSTOS:\r\n\r\nCOMBATE (Incluye MMA, Grappling, Muay Thai, Box, Tae Kwon Do):\r\nInscripción - $500 pesos\r\nMensualidades - $500 pesos (por 12 clases al mes, o bien, 3 clases a la semana); $800 pesos (libre, ilimitado número de clases en cualquier horario).\r\n\r\nSÑ“LO BOX\r\nInscripción - $250 pesos\r\nMensualidad - $400 pesos (por clases diarias en cualquier horario de box)\r\n\r\nCOMBATE+FUST:\r\nInscripción - $500 pesos\r\nMensualidad - $1000 pesos (incluye 20 clases de FUST y 20 clases de Combate durante el mes, o bien, 5 clases por semana en cada área).\r\n\r\nEquipo bonebreakers mma  , box, grappling , kick boxing , muay thai , yoga , lucha olómpica , acondicionamiento multifuncional (FUST) , equipo de pesas , cafeteria , clases de baile y talleres de música', 400);
