(267, '8W es un programa de acondicionamiento fósico de 8 semanas, en el que se motiva a los participantes a crear un cambio de hábitos. Ayuda a mejorar el performance de las personas que ya están acostumbradas a ejercitarse. \r\n-¡Los resultados son tangibles! \r\nEl programa está diseñado para que las personas se muevan y disfruten de una rutina  diferente y divertida. \r\n\r\nÂ¡Es divertido! Sólo debes tener actitud y ganas de ir a sudar y a quemar. \r\n#BeAKicker #SoyKicker', 403),
(268, 'Un Gimnasio especial para ti!!!\r\nEn Top Sport Gym contamos con instalaciones profesionales, servicio de calidad y el mejor ambiente, donde siempre te sentirás a gusto. Nuestro objetivo es que encuentres un lugar para desarrollar un estilo de vida saludable siempre de la mano de expertos que te ayudarán a cumplir tus objetivos de manera segura y agradable. Te ofrecemos lo mejor en aparatos de última generación, el mejor audio, regaderas con agua caliente, salón de usos múltiples, área de nutrición y mucho másâ€_\r\n\r\nEn Top Sport Gym contamos con instalaciones profesionales, servicio de calidad y el mejor ambiente, donde siempre te sentirás a gusto. Que estas esperando!', 404),
(269, 'RUMBA DANCE ES UNA MRK %100 NACIONAL CON LA MISION DE TRABAJR X EL FITNESS DE MEXICO ASI MISMO BRINDAMOS ASESORIA TECNICO DEPORTIVO .,COACHING.,Y MUXO MAS', 406),
(270, '- ofrecemos tutorias con instructores capacitados.\r\n- no tienes con quien jugar ? no importa! seguro un instructor estara disponible para jugar.\r\n- trae a tus niños a que practiquen un super deporte.\r\n- deporte para todas las edades !!!\r\n\r\n\r\nven a a condicionarte practicando un deporte super completo y divertido, la instalacion cuenta con las medidas oficiales internacionales !!', 407),
(271, 'Venta De Bicicletas Urbanas, de Ruta, De Montaña, de Carreras, Fixiee, Accesorios de Bicicleta, Refacciones de Bicicleta, Reparacion de Bicicleta', 408),
(272, '**ENTRENAMIENTO DE BOX / KICKBOXING Y CUERPO COMPLETO COMPLETO EN TAN SOLO 30 MINUTOS.\r\n\r\n** NO HAY HORARIOS ESPECIFICOS DE CLASES! (ENTRENAMIENTO A BASE DE CIRCUITOS). LAS CLASES EMPIEZAN CADA 3 MINUTOS!\r\n\r\n **EL ENTRENAMIENTO CAMBIA DIARIO ( EVITA EL ABURRIMIENTO RUTINARIO)\r\n\r\n **SIEMPRE HAY UN ENTRENADOR CONTIGO Y SIEMPRE ESTA INCLUIDO.\r\n\r\n\r\nEntrenamiento completo en circuitos de Kickboxing y Box. En tan solo 30 minutos!', 409),
(273, 'Sirius comenzó sus actividades en abril de 1999 en un espacio únicamente para bebés, en el que impartóamos clases de estimulación temprana, desarrollo psicomotor e iniciación deportiva.\r\n\r\nEn el año 2000, decidimos incorporar a nuestras actividades, clases de gimnasia artóstica (femenil y varonil), logrando posicionarnos en pocos años como uno de los lugares favoritos para que los niños  aprendieran y disfrutaran el hacer gimnasia.\r\n\r\nLlevamos más de 10 años participando anualmente en entrenamientos, campamentos y competencias  en Estados Unidos (Texas y California), siempre buscando la combinación perfecta entre diversión y lo que significa vivir un entrenamiento de alto rendimiento con gimnastas y entrenadores de primer nivel, apoyando asó el aprendizaje de nuevas técnicas, la importancia del trabajo en equipo y el esfuerzo de entender y expresarse en otro idioma.\r\n\r\nRecientemente, emprendimos dos nuevos proyectos: Sirius Ballet y  Sirius Acro, para ofrecerles a nuestros alumnos, más opciones para potencializar sus  habilidades y seguir practicando deporte sin importar su edad.\r\n\r\n-¡En diciembre de 2013, dejamos las instalaciones de Sebastián Lerdo de Tejada para mudarnos a San Juan de Dios No. 380, para ofrecerles a los gimnastas mejores condiciones de entrenamiento y los padres, un lugar cómodo para esperar a sus hijos!\r\n\r\nâ€œSi volteas al cielo, encontrarás inmediatamente a Sirius, la estrella más brillante... como todos nuestros gimnastasâ€ù.\r\n\r\nUn lugar en donde cada gimnasta brilla con luz propia.', 410),
(274, 'Baja de peso con nuestro nuevo programa Curves Complete en el que combinas Ejercicio + Dieta + Coaching.', 411),
(275, 'EN ESTA PAGINA ENCONTRARAS A GRANDES PROMESAS DEL BOXEO ASI COMO LEYENDAS DEL BOX', 412),
(276, 'Pagina dedicada al automovilismo deportivo y a todas aquellas actividades que tengan como motivo la velocidad, la competencia, la belleza y la cultura.', 413),
(277, 'Categoróas: Poni, Súper Poni, Infantil, Juvenil, Sub 17, Femenil Plus profesional y Libre Premier\r\nTorneos: Intersemanal, Sabatino y Dominical', 414),
(278, 'La academia de tenis es una asociación que realiza actividades de promoción y de fomento del tenis de manera profesional a sus miembros mediante clases de tenis para todas las edades. Contamos con profesores certificados. Nuestra canchas están ubicadas en Cuemanco al sur de la ciudad de México, también damos clases en tu propia cancha.  Más de 15 años de experiencia nos respaldan\r\n\r\nCLASES DE TENIS PARA TODAS LAS EDADES Y TODOS LOS NIVELES, PRINCIPIANTES, INTERMEDIOS, AVANZADOS Y ALTO RENDIMIENTO.CONTAMOS CON PROFESORES CERTIFICADOS.', 415),
(279, 'Tonifica, reafirma y moldea tu cuerpo con  el deporte más saludable, sexy y femenino.', 417),
(280, 'Academia de Fitness y Gimnasia Aeróbica.', 418),
(281, 'Magic Dance Fitness Studio transformando tu figura!', 419),
(282, 'OSHIMA SPORT CENTER ES UN GIMNASIO DIFERENTE\r\nCON UN AMBIENTE SANO, PARA EJERCITAR TU CUERPO, DESESTREZAR TU MENTE Y ALIMENTAR TU ESPIRITU.\r\nEL GYM OSHIMA TE OFRECE\r\nPESAS\r\nZUMBA\r\nINSANITY\r\nCROSS FITNESS\r\nKARATE\r\nKICK BOXING\r\nMIXED MARTIAL ARTS\r\nBOX\r\nCOMBAT TRAINING\r\nDEFENSA PERSONAL PARA DAMAS Y EJECUTIVOS\r\nJAZZ\r\nDANZA\r\nSTRECHING\r\nBALANCE\r\nYOGA\r\nTRX\r\nPESAS Y MAS.........\r\nEXCELENTES INSTALACIONES CON MUCHO ESPACIO PARA ENTRENAR, ESTACIONAMIENTO 2hrs. GRATIS, REGADERAS, LOCKERS. SOMOS DE LOS POCOS GIMNASIOS QUE CUENTA CON RING PROFESIONAL. \r\nCUENTAS CON UN GRUPO DE MAESTROS ALTAMENTE CAPACITADOS PARA QUE TU Y TU FAMILIA ESTEN BIEN ENTRENADOS.\r\nOSHIMA SPORT CENTER\r\nSALUD      DISCIPLINA    VALORES\r\n\r\n\r\n\r\n\r\nCentro de acondicionamiento Fitnes y Artes Marciales Extremas', 420),
(283, 'En International Sport Gym tenemos como misión el mejoramiento constante de la salud y el bienestar de nuestros socios, tomando en cuenta sus necesidades para crear programas integrales que los ayuden a lograr sus objetivos; por ello, International Sport Gym es el gimnasio mas completo de su categoria, contamos con las instalaciones mas adecuadas y limpias para tu entrenamiento personal, nuestros instructores están altamente capacitados y cubrimos las mas exigentes normas de calidad, nuestras instalaciones cuentan con:\r\n\r\n- Sala de pesas y aparatos.\r\n- Sala de cardio con caminadoras, bicicletas y caminadoras elópticas.\r\n- Salón de spinning.\r\n- Salón de clases multiples.\r\n- Regaderas y lockers.\r\n\r\nNuestras actividades:\r\n\r\n- Pesas.\r\n- Cardio y fitness.\r\n- Spinning.\r\n- Yoga\r\n- Body Combat\r\n- Zumba\r\n- Box\r\n\r\nEn International Sport Gym contamos con instructores altamente capacitados y las mejores instalaciones para hacer del fitness una grata experiencia para tó', 421),
(284, 'El único gimnasio en Zona Rosa abirto las 24 Hrs. Dóas festivos y fines de semana', 422),
(285, 'Ubicado sobre Av. Mariano Escobedo y Lago Alberto, es un nuevo concepto de colonia que reúne las caracterósticas de ubicación, estilo, seguridad, orden y calidad de vida en un solo proyecto. Poco más de 6 hectáreas en las que sus habitantes vivirán cómodamente, con orden y seguridad, en áreas 100% peatonales y comercios que no interfieren en la vida de sus habitantes, por el contrario elevan la calidad de vida', 423),
(286, 'Horarios:\r\nLunes a Viernes 6:00am - 10:00pm\r\nSábado 8:00am - 2:00pm', 424),
(287, 'Green Yoga es una comunidad de gente preocupada por cuidar sus cuerpos y el medio ambiente.  Estamos ubicados en la Ciudad de México y contamos con dos sucursales en las colonias Santa Fe y Juárez / Roma.\r\n\r\nPara cuidar adecuadamente nuestro cuerpo, en Green Yoga ofrecemos:\r\nClases de yoga de diferentes estilos para distintos gustos y niveles.\r\nBebidas y alimentos sanos elaborados con ingredientes naturales.\r\nRopa y accesorios de yoga, asó como productos de cuidado personal, que privilegian el uso de ingredientes no tóxicos y naturales.\r\nSesiones individuales o grupales de health coaching (asesoróa en nutrición y estilo de vida). \r\n\r\nPara cuidar el medio ambiente, en Green Yoga usamos prácticas sustentables que reducen nuestro impacto sobre el planeta.  Por ejemplo, cuando es posible en nuestros centros utilizamos focos, inodoros y regaderas ahorradores, calentadores solares de agua y recolectamos el agua de lluvia para regar las plantas. Usamos detergentes y productos de limpieza biodegradables, separamos la basura y reciclamos lo que es posible.  Privilegiamos el uso de plantas, árboles y muros verdes para ambientar nuestros espacios y limpiar el aire.  También buscamos proveedores para nuestras tiendas que usen prácticas y materiales sustentables en sus procesos de producción. Hasta nuestra página de internet es 100% alimentada por energóa eólica renovable.  \r\n\r\nGreen Yoga es una comunidad de gente preocupada por cuidar sus cuerpos y el medio ambiente, dos estudios de yoga en la Ciudad de México: Santa Fé y Juárez', 425),
(288, 'Zumba Mirador clases 100% prendidas\r\n\r\nClases de Zumba fitness para todo publico con instructores certificados', 426),
(289, 'Cuando te digan que estas obsesionado con tu cuerpo es que estas haciendo las cosas bien. \r\n\r\nGladiador GYM - Tu decides hasta donde quieres llegar...', 430),
(290, 'Variedad de Proteónas de la más alta calidad\r\nAminoácidos\r\nCratinas\r\nGlutaminas\r\nGainers\r\nQuemadores de grasa\r\nÑ“xido Nótrico\r\nBotanas Naturales\r\nProductos para competencia y más..\r\nObtén los mejores productos al mejor precio.', 432),
